import React from 'react';
import data from './data';

const Card = (props) => {
    return(
        <React.Fragment>
             <div className="card" >
                <img class="card-img-top" src={props.imgsrc} alt="Card image cap" />
                <div class="card-body">
                    <h5 class="card-title">{props.title}</h5>
                    <p class="card-text">{props.sname}</p>
                    <a href="#" class="btn btn-primary">{props.link}</a>
                </div>
            </div>
        </React.Fragment>
    )
};

export default Card;
